var queryURL = "https://icanhazdadjoke.com/";


export const getJokes = () => {
    let jokes = [];
    for(var i = 0; i <= 10; i++){
        fetch(queryURL,{
            method:"GET",
            headers:{
                Accept: 'application/json',
            }
        })
        .then(res => {
            // console.log(res.json())
            jokes.push(res.json()) 
        })
        .catch(err => {
            console.log(err)
        })
    }
    return jokes;

};
